int32_t averageCalc(int32_t newValue, int32_t oldValue, int32_t count){
	int32_t aux = 0;

	aux = (oldValue * count) + newValue;
	aux /= count + 1;

	return aux;
}

int32_t normCalc(int32_t number){
	if(number < 0)
		number *= -1;

	return number;
}

